
#VARIABLE START
instructions = '''
 
 
 
 
 
'''
keypad = [
['X', 'X', 'X', 'X', 'X'],
['X', '1', '2', '3', 'X'],
['X', '4', '5', '6', 'X'],
['X', '7', '8', '9', 'X'],
['X', 'X', 'X', 'X', 'X']]
yaxis = 2
xaxis = 2
position = keypad[yaxis][xaxis]  # starting position
#VARIABLE END

#FUNCTION START
for instruction in instructions:

	if instruction == 'U':					#UP
		yaxis -= 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			yaxis += 1
		
	if instruction == 'D':					#DOWN
		yaxis += 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			yaxis -= 1
		
	if instruction == 'L':					#LEFT
		xaxis -= 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			xaxis += 1

	if instruction == 'R': 					#RIGHT
		xaxis += 1
		position = keypad[yaxis][xaxis]
		if position == 'X':
			xaxis -= 1
		
	if instruction == ' ':					#Space, print
		print(position)
#FUNCTION END